import React, { Component } from "react";

const listGlasses = [
  {
    imgGlasses: "./img/glassesImage/v1.png",
    priceGlasses: " $50",
    brachGlasses: "DIOR G8759H",
  },
  {
    imgGlasses: "./img/glassesImage/v2.png",
    priceGlasses: " $100",
    brachGlasses: "GUCCI GGG8759H",
  },
  {
    imgGlasses: "./img/glassesImage/v3.png",
    priceGlasses: " $1040",
    brachGlasses: "DIORS GGG8759H",
  },
  {
    imgGlasses: "./img/glassesImage/v4.png",
    priceGlasses: " $5043",
    brachGlasses: "DIOR G8759H",
  },
  {
    imgGlasses: "./img/glassesImage/v5.png",
    priceGlasses: " $160",
    brachGlasses: "GUCCI GGG8759H",
  },
  {
    imgGlasses: "./img/glassesImage/v6.png",
    priceGlasses: " $160",
    brachGlasses: "DIORS GGG8759H",
  },
  {
    imgGlasses: "./img/glassesImage/v7.png",
    priceGlasses: " $50",
    brachGlasses: "DIOR G8759H",
  },
  {
    imgGlasses: "./img/glassesImage/v8.png",
    priceGlasses: " $50",
    brachGlasses: "DIOR G8759H",
  },
  {
    imgGlasses: "./img/glassesImage/v9.png",
    priceGlasses: " $50",
    brachGlasses: "DIOR G8759H",
  },
];

export default class Glasses extends Component {
  renderListGlasses() {
    <div className="col-3">
      <button className="btn btn-outline-secondary">
        <img
          src="./img/glassesImage/v1.png"
          alt="hinh"
          style={{ width: 100, borderRadius: 20 }}
        />
      </button>
    </div>;
  }
  render() {
    return (
      <div>
        <section className="glasses-app bg-dark" style={{ height: "100vh" }}>
          <h2 className="text-center h2 text-white py-1">Glasses App</h2>
          <div className="d-flex justify-content-center align-items-center">
            <div className="container row">
              <section className="model d-flex justify-content-center col-5">
                <div
                  className="card text-left"
                  style={{ width: 300, position: "relative" }}
                >
                  <img
                    className="card-img-top"
                    src="./img/glassesImage/model.jpg"
                    alt="hinh model"
                  />
                  <img
                    src="./img/glassesImage/v5.png"
                    alt="kinh"
                    style={{
                      width: 170,
                      position: "absolute",
                      left: "50%",
                      transform: "translateX(-50%)",
                      top: "16%",
                    }}
                  />
                  <div className="card-body">
                    <span className="card-title badge-danger h3 px-2 rounded">
                      $30
                    </span>
                    <p className="card-text mt-2">PRADA P8750</p>
                  </div>
                </div>
              </section>
              <section className="glasses__list mt-4 d-flex justify-content-around flex-wrap col-7">

              </section>
            </div>
          </div>
        </section>
      </div>
    );
  }
}
